import React, { useEffect, useState } from "react";
import { getExistingCampaign } from "../../api/Api";
export default function Consulting() {
  const [data,setData] = useState([]);
  useEffect(() => {
    getExistingCampaign().then((res) => {

      setData(res.data)
      console.log("res", res);
    });
  });
  return (
    <>
      <div>
        <h1>Existing campaign</h1>
        <select id="dropdown">
          <option value="N/A">Select</option>
          {data && data.length > 0 && data.map((op,index)=>{
              return <option value={index}>{op}</option>
          })}


        </select>
      </div>
    </>
  );
}
